import React from 'react';

let TodoList = ({ todoList, todoDeleteHandler }) =>


class TodoList extends React.Component {
    render = () => <table>
    <tbody>
        {todoList.map(todo =>
            <tr>
                <td onClick={() => this.crossTodo(todo.id)}>{todo.text}</td>
                <td><button onClick={() => todoDeleteHandler(todo.id)}>-</button></td>
            </tr>
        )}
    </tbody>
</table>
}

export default TodoList;
